# A Second-order Taylor Expansion for $\mathbf{Z}$ 

For $\mathbf{Z}=\left[\begin{array}{l}Z^{(1)}=\cos \left(\theta^{*}\right) \\ Z^{(2)}=\sin \left(\theta^{*}\right)\end{array}\right]$

$$
\begin{aligned}
Z^{(1)} & =\cos \theta^{*} \\
& \approx \cos \theta-(\sin \theta)\left(\theta^{*}-\theta\right)-\frac{1}{2}(\cos \theta)\left(\theta^{*}-\theta\right)^{2} \\
& \approx(\sin \theta)\left(\theta^{*}-\theta\right)-\cos \theta\left(1-\frac{\left(\theta^{*}-\theta\right)^{2}}{2}\right) \\
\mathbb{E}\left(Z^{(1)}\right) & \approx \cos \theta\left(1-\frac{\sigma_{\psi}^{2}}{2}\right) \\
\operatorname{Var}\left(Z^{(1)}\right) & \approx(\sin \theta)^{2} \sigma_{\psi}^{2}+\frac{1}{2}(\cos \theta)^{2} \sigma_{\psi}^{4}
\end{aligned}
$$

and

$$
\begin{aligned}
Z^{(2)} & =\sin \theta^{*} \\
& \approx \sin \theta+(\cos \theta)\left(\theta^{*}-\theta\right)-\frac{1}{2}(\sin \theta)\left(\theta^{*}-\theta\right)^{2} \\
& \approx \cos \theta\left(\theta^{*}-\theta\right)-(\sin \theta)\left(1-\frac{\left(\theta^{*}-\theta\right)^{2}}{2}\right) \\
\mathbb{E}\left(Z^{(2)}\right) & \approx(\sin \theta)\left(1-\frac{\sigma_{\psi}^{2}}{2}\right) \\
\operatorname{Var}\left(Z^{(2)}\right) & \approx(\cos \theta)^{2} \sigma_{\psi}^{2}+\frac{1}{2}(\sin \theta)^{2} \sigma_{\psi}^{4}
\end{aligned}
$$

and by letting $\mathrm{C}=\cos (\theta)$ and $\mathrm{S}=\sin (\theta)$, we have

$$
\begin{gathered}
\operatorname{Cov}\left(Z^{(1)}, Z^{(2)}\right) \approx-\mathrm{SC} \sigma_{\psi}^{2}+\frac{1}{2} \mathrm{SC} \sigma_{\psi}^{4} \\
{\left[\begin{array}{l}
Z^{(1)} \\
Z^{(2)}
\end{array}\right] \stackrel{\text { approx }}{\sim} \mathbf{N}_{2}\left(\left[\begin{array}{l}
\cos (\theta)-\frac{1}{2} \cos (\theta) \sigma_{\psi}^{2} \\
\sin (\theta)-\frac{1}{2} \sin (\theta) \sigma_{\psi}^{2}
\end{array}\right], \sigma_{\psi}^{2}\left[\begin{array}{rrr}
\mathrm{S}^{2}+\frac{1}{2} \mathrm{C}_{1}^{2} \sigma_{\psi}^{2} & -\mathrm{SC}+\frac{1}{2} \mathrm{SC} \sigma_{\psi}^{2} \\
-\mathrm{SC}+\frac{1}{2} \mathrm{SC} \sigma_{\psi}^{2} & \mathrm{C}^{2}+\frac{1}{2} \mathrm{~S}^{2} \sigma_{\psi}^{2}
\end{array}\right]\right) .
\end{gathered}
$$
